import React from 'react';
import './VerticalMenu.css'; // 스타일을 위한 CSS 파일

const VerticalMenu = () => {
    const menuItems = ['홈', '소개', '서비스', '연락처'];

    return (
        <div className="vertical-menu">
            <ul>
                {menuItems.map((item, i) => (
                    <li key={i}>{item}</li>
                ))}
            </ul>
        </div>
    );
};

export default VerticalMenu;
